	$translations['M00024']['chineseTraditional'] = "";
	$translations['M00024']['Malay'] = "Kunci dompet anda disimpan dalam telefon bimbit anda.Oleh itu, tiada siapa yang mempunyai keupayaan untuk membuat salinan kunci unik dompet  anda selain diri anda.";
	$translations['M00024']['Indonesia'] = "Kunci dompet anda disimpan di ponsel anda. Karena itu, tidak ada yang memiliki kemampuan untuk membuat salinan unik dompet anda selain diri anda sendiri.";
