	$translations['M00026']['english'] = "We ask you to use your cellphone number to ensure that your wallet is protected. In order to access your TheNux wallet, your number and wallet key will both be required. ";
	$translations['M00026']['chineseSimplified'] = "";
	$translations['M00026']['chineseTraditional'] = "";
	$translations['M00026']['Malay'] = "Kami meminta anda untuk menggunakan nombor telefon anda untuk memastikan bahawa dompet anda dilindungi.Untuk mengakses wallet TheNux anda, kekunci nombor dan dompet anda kedua-duanya akan diperlukan.";
	$translations['M00026']['Indonesia'] = "Kami meminta anda menggunakan nomor telepon anda untuk memastikan dompet anda terlindungi. Untuk mengakses dompet TheNux anda, nomor dan kunci dompet anda akan diperlukan.";
	$translations['M00026']['Japanese'] = "TheNux";
	$translations['M00026']['Korean'] = "            . TheNux   ,   Wallet Key .";
	$translations['M00026']['Spanish'] = "Le pedimos que use su nmero de celular para asegurarse de que su billetera est protegida. Para acceder a su billetera de TheNux, se requerirn su nmero y la clave de su billetera.";
	$translations['M00026']['Portuguese'] = "Ns pedimos que voc use o nmero do seu celular para garantir que a sua carteira esteja protegida. Para acessar a sua carteira TheNux, o seu nmero e a chave da sua carteira sero exigidos.";
	$translations['M00026']['Thai'] = "  TheNux ";
	$translations['M00026']['Filipino'] = "Hinihingi namin sa iyong gamitin ang cellphone mo upang tiyaking ang pitaka mo ay protektado. Upang ma-access ang iyong pitakang TheNux, hihilingin kapwa ang numero mo at susi ng pitaka.";

