	$translations['M00028']['english'] = "Unlike other digital wallets, we do not use a 12-phrase backup system. Since TheNux backup system requires both your wallet key and cellphone number, if somebody was to steal your wallet key, they would still not be able to access your wallet without having access to your phone as well. ";
	$translations['M00028']['chineseSimplified'] = "12TheNux";
	$translations['M00028']['chineseTraditional'] = "12TheNux";
	$translations['M00028']['Malay'] = "Tidak seperti dompet digital yang lain, kami tidak menggunakan sistem sandaran frasa-12.Sistem  sandaran TheNux memerlukan kedua-dua kunci dompet dan nombor telefon bimbit anda, jika seseorang ingin mencuri kunci dompet anda, mereka masih tidak boleh mengakses dompet anda tanpa mempunyai akses kepada telefon anda juga.";
	$translations['M00028']['Indonesia'] = "Tidak seperti dompet digital lainnya, kami tidak menggunakan sistem cadangan frasa-12. Sistem sandaran The Nux membutuhkan dompet dan kunci telepon anda, jika seseorang ingin mencuri kunci dompet anda, mereka masih tidak dapat mengakses dompet anda tanpa memiliki akses ke telepon anda juga.";
	$translations['M00028']['Japanese'] = "12TheNux";
	$translations['M00028']['Korean'] = "   , 12    . TheNux    Wallet Key      ,   Wallet Key         .";
	$translations['M00028']['Spanish'] = "A diferencia de otras carteras digitales, no utilizamos un sistema de respaldo de 12 frases. Como el sistema de respaldo de TheNux requiere la clave de su billetera y el nmero de su telfono celular, si alguien llegara a robar la llave de su billetera, no podr acceder a su billetera sin tener acceso a su telfono tambin.";
	$translations['M00028']['Portuguese'] = "Diferente de outras carteiras digitais, ns no usamos um sistema de backup de 12 frases. J que o sistema de backup do TheNux requer a chave da sua carteira e o seu nmero de celular, se algum roubar a chave da sua carteira, essa pessoa anda no seria capaz de acessar a sua carteira sem ter acesso ao seu telefone tambm.";
	$translations['M00028']['Thai'] = " 12   TheNux  ";
	$translations['M00028']['Filipino'] = "Hindi tulad ng ibang pitakang digital, hindi kami gumagamit ng isang 12-pariralang sistema ng backup. Yamang hinihiling ng sistema ng backup ng TheNux kapwa ang pitaka mo at numero ng cellphone, kung may magnanakaw ng susi ng pitaka mo, hindi pa rin nila maa-access ang pitaka mo kung wala ring access sa telepono mo.";

