	$translations['M00030']['Korean'] = "TheNux     ,      .         .";
	$translations['M00030']['Spanish'] = "Si tiene problemas tcnicos relacionados con TheNux, puede contactarnos en cualquier momento. Nuestro amable equipo de soporte se pondr en contacto con usted de inmediato.";
	$translations['M00030']['Portuguese'] = "Se voc estiver enfrentando problemas tcnicos relacionados ao TheNux, voc pode entrar em contato conosco a qualquer hora. A nossa equipe de suporte amigvel entrar em contato com voc prontamente.";
	$translations['M00030']['Thai'] = " TheNux  ";
