	$translations['M00484']['english'] = "TheNux eliminates your SMS cost, allows you to send bulk text messages to your opted-in customers for free. It is totally free 2-way messaging both locally and internationally, whilst improving and enhancing your customer service.";
	$translations['M00484']['chineseSimplified'] = "TheNux ";
	$translations['M00484']['chineseTraditional'] = "TheNux";
	$translations['M00484']['Malay'] = "TheNux menghapuskan kos SMS anda dan membolehkan anda untuk menghantar mesej teks secara pukal kepada pelanggan pilihan anda secara percuma. Ia adalah mesej 2-hala yang percuma untuk tempatan dan di luar negara, malah ianya dapat memperbaiki dan meningkatkan perkhidmatan pelanggan anda.";
	$translations['M00484']['Indonesia'] = "TheNux menghapuskan biaya SMS anda dan memungkinkan anda untuk mengirim pesan teks massal ke pelanggan (pilihan/opt-in) anda secara gratis. Ini sepenuhnya gratis buat pengiriman pesan 2 arah baik lokal maupun internasional, sambil memperbaiki dan meningkatkan layanan pelanggan anda.";
