	$translations['M01307']['english'] = "Before you start OTC trading you need to consider what payment methods you are going to provide and research the payment method so that you know how it works. When you first start trading, we recommend you don't choose a high-risk payment method. Transfer with specific local bank can be a good starting payment method, especially if there are few traders active in your country.";
	$translations['M01307']['chineseSimplified'] = "OTC";
	$translations['M01307']['chineseTraditional'] = "OTC";
	$translations['M01307']['Malay'] = "Sebelum memulakan perdagangan OTC, anda perlu mempertimbangkan kaedah pembayaran yang akan anda tawarkan dan selidik kaedah pembayaran tersebut supaya anda tahu bagaimana ianya berfungsi. Apabila anda memulakan perdagangan, kami mengesyorkan anda tidak memilih kaedah pembayaran yang berisiko tinggi. Pemindahan wang dengan bank tempatan yang tertentu boleh menjadi kaedah pembayaran permulaan yang baik, terutamanya jika terdapat beberapa pedagang yang aktif di negara anda.";
	$translations['M01307']['Indonesia'] = "Sebelum anda memulai perdagangan OTC, anda perlu mempertimbangkan metode pembayaran apa yang akan anda tawarkan dan teliti metode pembayaran sehingga anda tahu cara fungsinya. Saat pertama kali memulai perdagangan, kami sarankan anda tidak memilih metode pembayaran yang berisiko tinggi. Transfer wang dengan bank lokal tertentu akan dapat menjadi metode pembayaran awal yang baik, terutama jika ada beberapa pedagang yang aktif di negara anda.";
	$translations['M01307']['Japanese'] = "OTC";
	$translations['M01307']['Korean'] = "OTC                .           .       ,         .";
	$translations['M01307']['Spanish'] = "Antes de comenzar a operar con OTC, debe considerar qu mtodos de pago proporcionar e investigar su mtodo de pago para saber cmo funciona. Cuando comience a operar por primera vez, le recomendamos que no elija un mtodo de pago de alto riesgo. Una transferencia con un banco local especfico puede ser un buen mtodo de pago inicial, especialmente si hay pocos comerciantes activos en su pas.";
	$translations['M01307']['Portuguese'] = "Antes de comear a negociar em OTC, voc precisa considerar quais mtodos de pagamento voc vai proporcionar e pesquisar sobre o mtodo de pagamento para que voc saiba como ele funciona. Quando voc negociar pela primeira vez, ns recomendamos que voc no escolha um mtodo de pagamento de alto risco. Transferir com um banco local especfico pode ser um bom mtodo de pagamento inicial, especialmente se houver poucos negociantes ativos no seu pas.";
	$translations['M01307']['Thai'] = " OTC     ";
	$translations['M01307']['Filipino'] = "Bago mo simulan ang kalakalang OTC ay kailangan mong isaalang-alang kung anong paraan ng pagbabayad ang maibibigay mo at saliksikin ang paraan ng pagbabayad upang malaman mo kung paano ito gumagana. Sa una simula mo ng kalakalan inirerekomenda namun sa iyong huwag pumili ng paraan ng pagbabayad na mataas ang panganib. Ang paglilipat gamit ang isang tiyak na bangkong lokal ay maaaring isang mabuting panimulang paraan ng pagbabayad, lalo na kung may kakaunti lamang na nakikipagkalakalan sa bansa niyo.";

	$translations['M01308']['english'] = "If you have a new account with no previous trading history, we recommend you start by place order to existing advertisements for buy and sell cryptocurrency. This will help you get an idea of how OTC trading works and it will let you build some trading history which will make your accounttrustworthy which in turn gives your advertisements better placement in the listings.";
	$translations['M01308']['chineseSimplified'] = "OTC";
	$translations['M01308']['chineseTraditional'] = "OTC";
	$translations['M01308']['Malay'] = "Sekiranya anda mempunyai akaun baru tanpa sejarah perdagangan sebelumnya, kami mengesyorkan anda memulakan pesanan dengan iklan sedia ada untuk membeli dan menjual cryptocurrency. Ini akan membantu anda mendapatkan idea bagaimana perdagangan OTC berfungsi dan ia akan membolehkan anda membina beberapa sejarah perdagangan yang akan menjadikan akaun anda boleh dipercayai yang seterusnya memberikan penempatan iklan anda lebih baik dalam senarai tersebut.";
	$translations['M01308']['Indonesia'] = "Jika anda memiliki akun baru tanpa sejarah perdagangan sebelumnya, kami menyarankan anda untuk mulai dengan  pesanan untuk iklan yang ada untuk membeli dan menjual cryptocurrency. Ini akan membantu anda mendapatkan ide tentang bagaimana perdagangan OTC bekerja dan itu akan memungkinkan anda membangun beberapa sejarah perdagangan yang akan membuat akun anda dapat dipercaya dan akan memberi iklan anda penempatan yang lebih baik dalam daftar.";
	$translations['M01308']['Japanese'] = "OTC";
	$translations['M01308']['Korean'] = "      ,            .                        .";
	$translations['M01308']['Spanish'] = "Si tiene una cuenta nueva sin historial de intercambios, le recomendamos que empiece colocando rdenes en anuncios existentes de compra/venta de criptomonedas. Esto le ayudar a tener una idea de cmo funcionan los intercambios OTC y le permitir crear un historial de transacciones que har que su cuenta sea confiable, lo que a su vez le dar a sus anuncios una mejor ubicacin en las listas.";
	$translations['M01308']['Portuguese'] = "Se voc tiver uma nova conta sem nenhum histrico prvio de negociao, ns recomendamos que voc comece fazendo pedidos em anncios existentes para comprar e vender criptomoeda. Isso ir ajudar voc a ter uma ideia de como a negociao de OTC funciona e ir permitir que voc construa algum histrico de negociao que ir tornar a sua conta digna de confiana, o que, por sua vez, d aos seus anncios um melhor posicionamento nas listagens.";
	$translations['M01308']['Thai'] = "  cryptocurrency  OTC  ";
	$translations['M01308']['Filipino'] = "Kung may bago kang account na walang nakalipas na kasaysayan ng pagpapalitan, inirerekomenda naming magsimula ka sa pamamagitan ng paglalagay ng order sa mga umiiral na patalastas para sa pamimili at pagbebenta ng cryptocurrency. Bibigyan ka nito ng ideya kung paano gumagana ang pagpapalitan ng OTC at hahayaan ka nitong magtayo ng ilang kasaysayan sa pagpapalitan na gagawing katiwa-tiwala ang account mo na bilang sukli ay magbibigay sa mga patalastas mo ng mas mainam na mga paglilista.";

