	$translations['M01311']['english'] = "First time user? Open Wallets in TheNux to create a crypto wallet for your account, you need a to start trading. Start out by place order at other traders ads to buy and sell, this help you get your first rating and trade completions. The higher rating and more feedback you have, the more trustworthy you are.";
	$translations['M01311']['chineseSimplified'] = "TheNux";
	$translations['M01311']['chineseTraditional'] = "TheNux";
	$translations['M01311']['Malay'] = "Pengguna pertama kali? Buka Dompet di TheNux untuk mencipta dompet crypto untuk akaun anda, anda memerlukan dompet untuk memulakan perdagangan. Mulakan dengan membuat pesanan  dengan iklan perdagangan yang lain untuk membeli dan menjual, ini akan membantu anda untuk mendapatkan penarafan pertama dan juga penyelesaian perdagangan anda. Semakin tinggi penarafan dan banyak maklum balas yang anda miliki, maka anda akan lebih dipercayai.";
	$translations['M01311']['Indonesia'] = "Pengguna pertama kali? Buka Dompet di TheNux untuk mencipta dompet crypto untuk akun anda, Anda membutuhkan dompet untuk memulai perdagangan. Mulailah dengan memesan di iklan pedagang lain untuk membeli dan menjual, ini membantu anda untuk mendapatkan peringkat pertama dan juga penyelesaian buat perdagangan anda. Semakin tinggi peringkat anda dan semakin banyak umpan balik yang anda miliki, semakin anda dapat lebih dipercaya.";
	$translations['M01311']['Japanese'] = "? TheNux";
	$translations['M01311']['Korean'] = " ?          TheNux  .         ,      .       ,   .";
	$translations['M01311']['Spanish'] = "Es su primera Vez? Abra Billeteras en TheNux para crear una cartera de criptomonedas para su cuenta; necesitar de una cartera para comenzar a operar. Comience colocando una orden en el anuncio de uno de los comerciantes para comprar o vender, esto le ayudar a recibir su primera calificacin y a completar su primer intercambio. Mientras mayor sea su calificacin y ms comentarios tenga, ms confiable ser.";
	$translations['M01311']['Portuguese'] = "Usurio de primeira viagem? Abra Carteiras no TheNux para criar uma criptocarteira para a sua conta. Voc precisa de uma carteira para comear a negociar. Comece fazendo um pedido nos anncios de outros negociantes para comprar e vender, isso ajuda voc a conseguir a sua primeira avaliao e fechamentos de negociaes. Quanto mais alta a avaliao e quanto mais feedback voc tiver, mas digno de confiana voc .";
	$translations['M01311']['Thai'] = "  TheNux  Crypto      ";
	$translations['M01311']['Filipino'] = "Unang beses ba gumagamit? Magbukas ng mga pitaka sa TheNux upang lumikha ng isang pitakang crypto para sa account mo, kailangan mo ng pitaka upang simulang makipagpalitan. Magsimula sa pamamagitan ng paglalagay ng order sa mga patalastas ng ibang nakikipagpalitan sa pamimili at pagbebenta, tutulungan ka nitong makakuha ng una mong pagsusuri at mga pagkakumpleto ng pagpapalitan. Higit na mataas ang pagsusuri at higit na marami kang tugon na makuha, higit na magiging katiwa-tiwala ka.";

