	$translations['M01313']['english'] = "It's also a good idea to verify your account by completing both the National ID or Passport. A verified account is more trustworthy for buyers and will help you get more customers. You can verify your account insidethe account setting.";
	$translations['M01313']['chineseSimplified'] = "";
	$translations['M01313']['chineseTraditional'] = "";
	$translations['M01313']['Malay'] = "Ianya idea yang baik untuk supaya mengesahkan akaun anda dengan melengkapkan kedua-dua ID Kebangsaan atau Pasport. Akaun yang telah disahkan akanlebih dipercayai oleh pembeli dan akan membantu anda mendapatkan lebih ramai pelanggan. Anda boleh mengesahkan akaun anda dalam tetapan akaun.";
	$translations['M01313']['Indonesia'] = "Ini juga merupakan ide yang baik untuk memverifikasi akun anda dengan melengkapi ID Nasional atau Paspor. Akun yang terverifikasi lebih dapat dipercaya oleh pembeli dan akan membantu anda mendapatkan lebih banyak pelanggan. Anda dapat memverifikasi akun Anda di dalam pengaturan akun.";
	$translations['M01313']['Japanese'] = "ID";
	$translations['M01313']['Korean'] = "      .               .        .";
	$translations['M01313']['Spanish'] = "Tambin es una buena idea verificar su cuenta ingresando tanto su identificacin nacional como el pasaporte. Una cuenta verificada es ms confiable para los compradores y le ayudar a obtener ms clientes. Puede verificar su cuenta dentro de la configuracin de la cuenta.";
	$translations['M01313']['Portuguese'] = "Tambm  uma boa ideia verificar a sua conta incluindo a Carteira de Identidade ou o Passaporte. Uma conta verificada  mais digna de confiana para os compradores e ir ajudar voc a conseguir mais clientes. Voc pode verificar a sua conta dentro das configuraes de conta.";
	$translations['M01313']['Thai'] = "  ";
	$translations['M01313']['Filipino'] = "Isa ring mabuting ideya na patunayan ang account mo sa pamamagitan ng pagkumpleto kapwa ng Pambansang ID o Pasaporte. Mas katiwa-tiwala ang isang napatunayang account para sa mga mamimili at tutulungan kang magkaroon ng higit na suki. Maaari mong patunayan ang account mo sa loob ng pagtatakda ng account.";

