	$translations['M01315']['english'] = "Read through other traders advertisement of the same payment method and make some trades with them. Try to identify possible problems before you start trading. We recommend you start trading using a low risk payment method.";
	$translations['M01315']['chineseSimplified'] = ",  ";
	$translations['M01315']['chineseTraditional'] = ", ";
	$translations['M01315']['Malay'] = "Baca iklan dari peniaga lain iklan yang mempunyai kaedah pembayaran yang sama dan cuba untuk membuat beberapa perdagangan dengan mereka. Cubalah untuk mengenal pasti tentang kemungkinan masalah sebelum memulakan perdagangan. Kami mengesyorkan anda memulakan perdagangan dengan menggunakan kaedah pembayaran risiko yang rendah.";
	$translations['M01315']['Indonesia'] = "Baca iklan dari pedagang lain yang memiliki metode pembayaran yang sama dan lakukan beberapa perdagangan dengan mereka. Cobalah untuk mengidentifikasi tentang kemungkinan masalah sebelum anda memulai perdagangan. Kami menyarankan anda memulai perdagangan menggunakan metode pembayaran yang berisiko rendah.";
	$translations['M01315']['Japanese'] = "";
	$translations['M01315']['Korean'] = "          .        .        .";
	$translations['M01315']['Spanish'] = "Lea los anuncios de otros comerciantes del mismo mtodo de pago y realice algunas operaciones con ellos. Trate de identificar posibles problemas antes de comenzar a operar. Le recomendamos que comience a operar utilizando un mtodo de pago de bajo riesgo.";
	$translations['M01315']['Portuguese'] = "Leia os anncios de outros negociantes com o mesmo mtodo de pagamento e faa algumas negociaes com eles. Tente identificar possveis problemas antes de comear a negociar. Ns recomendamos que voc comece a negociar usando um mtodo de pagamento de baixo risco.";
	$translations['M01315']['Thai'] = "   ";
	$translations['M01315']['Filipino'] = "Basahin ang patalastas ng ibang nakikipagkalakal ng katulad na paraan ng pagbabayad at magkaroon ng ilang kalakalan sa kanila. Subukang tukuyin ang ilang posibleng problema bago mo simulang makipagkalakalan. Inirerekomenda naming simulan mong makipagkalakalan gamit ang isang paraan ng pagbabayad na mababa ang panganib.";

