	$translations['M01317']['english'] = "Some payment providers will temporarily or permanently close your account if you receive unauthorized payments that are related to fraud. Using accounts only for Crypto trading protects your personal finances.";
	$translations['M01317']['chineseSimplified'] = " ";
	$translations['M01317']['chineseTraditional'] = "";
	$translations['M01317']['Malay'] = "Sesetengah pembekal pembayaran akan menutup akaun anda secara sementara atau secara kekal jika anda menerima pembayaran tidak sah yang berkaitan dengan penipuan. Gunakan akaun hanya untuk perdagangan Crypto untuk melindungi kewangan peribadi anda.";
	$translations['M01317']['Indonesia'] = "Beberapa penyedia pembayaran akan menutup sementara atau secara permanen akun anda jika anda menerima pembayaran tidak sah yang terkait dengan penipuan. Gunakan akun hanya untuk perdagangan Crypto untuk melindungi keuangan pribadi anda.";
	$translations['M01317']['Japanese'] = "";
	$translations['M01317']['Korean'] = "            .            .";
	$translations['M01317']['Spanish'] = "Algunos proveedores de pagos cerrarn temporal o permanentemente su cuenta si recibe pagos no autorizados que podran ser relacionados con fraudes. El uso de cuentas solo para el comercio de Criptomonedas proteger sus finanzas personales.";
	$translations['M01317']['Portuguese'] = "Alguns provedores de pagamento iro fechar temporria ou permanentemente a sua conta se voc receber pagamentos no autorizados que estejam relacionados a fraudes. Usar contas apenas para negociar Criptomoedas protege as suas finanas pessoais.";
	$translations['M01317']['Thai'] = "  ";
	$translations['M01317']['Filipino'] = "Pansamantala o permanenteng isasara ng ilang tagatustos ng pagbabayad ang account mo kung tatanggap ka ng mga di-awtorisadong bayad na kaugnay sa panloloko. Pinoprotektahan ng paggamit ng mga account na para lamang sa pagpapalitan ng Crypto ang mga personal mong pananalapi.";

