	$translations['M01320']['Indonesia'] = "Ada beberapa opsi ketika mencipta iklan yang diperlukan dan kami  memiliki bagian Info dan Keterangan untuk anda tuliskan pesanan penting. Menggunakan bagian Info dan Keterangan memungkinkan pembeli atau penjual anda lebih memahami tentang iklan anda sebelum melakukan pemesanan.";
