	$translations['M01333']['english'] = "The easy way to price your advertisement is to enter a ratio you want above the cryptocurrency market price. To do that, enter or choose a percentage in the floating ratio field.";
	$translations['M01333']['chineseSimplified'] = " ";
	$translations['M01333']['chineseTraditional'] = "";
	$translations['M01333']['Malay'] = "Cara mudah untuk menetapkan harga iklan anda adalah dengan memasukkan nisbah yang anda inginkan di atas harga pasaran cryptocurrency. Untuk melakukannya, masukkan atau pilih peratusan dalam medan nisbah terapung.";
	$translations['M01333']['Indonesia'] = "Cara mudah untuk menetapkan harga iklan anda adalah dengan memasukkan rasio yang anda inginkan di atas harga pasar cryptocurrency. Untuk melakukannya, masukkan atau pilih persentase di bidang rasio mengambang.";
	$translations['M01333']['Japanese'] = "";
	$translations['M01333']['Korean'] = "           .       .";
	$translations['M01333']['Spanish'] = "La forma ms fcil de colocarle un precio a su anuncio es ingresar la proporcin con la que quiere intercambiar con respecto al mercado de las criptomonedas. Para hacerlo, ingrese o elija un porcentaje en el campo de proporcin flotante.";
	$translations['M01333']['Portuguese'] = "O jeito fcil de precificar o seu anncio  inserir uma taxa que voc quiser acima do preo de mercado de criptomoedas. Para fazer isso, insira ou escolha uma porcentagem no campo da taxa de flutuao.";
	$translations['M01333']['Thai'] = " cryptocurrency ";
