	$translations['M01337']['Portuguese'] = "Selecione o mtodo de pagamento que voc quer oferecer. Voc pode pr-definir o seu mtodo de pagamento nas configuraes da sua conta. Seus detalhes de pagamento, como nome da conta e nmero da conta s podem ser vistos por pessoas que fizerem pedidos no seu anncio.";
	$translations['M01337']['Thai'] = "     ";
	$translations['M01337']['Filipino'] = "Piliin ang paraan ng pagbabayad na nais mong ihandog. Maaari mong itakda nang maaga ang paraan mo ng pagbabayad sa pagtatakda ng account. Ang mga detalye mo sa pagbabayad gaya ng pangalan ng account, numero ng account ay makikita lang ng taong naglagay ng order sa patalastas mo.";

