	$translations['M01339']['english'] = "The minimum transaction limit sets the smallest amount someone can buy. If you set it to five, and you have your currency set to USD it means that smallest trade someone can open with you will be for 5 USD. The maximum transaction limit sets what the biggest trade that you want to accept.";
	$translations['M01339']['chineseSimplified'] = " 55 ";
	$translations['M01339']['chineseTraditional'] = "55";
	$translations['M01339']['Malay'] = "Had transaksi minimum menetapkan jumlah terkecil yang boleh dibeli. Jika anda menetapkannya kepada lima, dan anda mempunyai set mata wang anda kepada USD ia bermakna perdagangan seseorang terkecil boleh dibuka dengan anda akan menjadi 5 USD. Had transaksi maksima menetapkan perdagangan yang paling besar yang anda mahu menerima dan amaun yang anda ingin beli atau menjual.";
	$translations['M01339']['Indonesia'] = "Batas transaksi minimum menetapkan jumlah terkecil yang boleh dibeli seseorang. Jika Anda menetapkannya menjadi lima, dan mata uang anda diatur ke USD, itu berarti perdagangan terkecil yang dapat dibuka seseorang dengan anda adalah 5 USD. Batas transaksi maksimum menentukan apa perdagangan terbesar yang anda ingin terima dan jumlah yang ingin anda beli atau jual.";
	$translations['M01339']['Japanese'] = "USD5(USD)";
	$translations['M01339']['Korean'] = "         . 5   USD       5USD .           .";
	$translations['M01339']['Spanish'] = "El lmite mnimo de transaccin establece la cantidad ms pequea que alguien puede comprar. Si lo establece en cinco y tiene su moneda establecida en USD, significa que la transaccin ms pequea que alguien puede abrir con usted ser de 5 USD. El lmite mximo de transaccin establece cul es la operacin ms grande que desea aceptar y la cantidad que desea comprar o vender.";
	$translations['M01339']['Portuguese'] = "O limite mnimo de transao define a quantia mnima que algum pode comprar. Se voc defini-lo para cinco, e voc tiver a sua moeda atual definida como USD isso significa que a menor negociao que algum pode abrir com voc ser de 5 USD. O limite mximo de transao define qual  a maior negociao que voc aceita e a quantia que voc quer comprar ou vender.";
	$translations['M01339']['Thai'] = "  5  USD   5 USD ";
	$translations['M01339']['Filipino'] = "Tinatakda ng pinakamababang limitasyon sa transaksyon ang pinakamaliit na presyong mabibili ng isang tao. Kung itatakda mo ito sa lima, at ang pananalapi mo ay nakatakda sa USD nangangahulugan itong ang pinakamaliit na palita na mabubuksan ng isang tao sa iyo ay 5 USD. Tinatakda ng pinakamataas nalimitasyon sa transaksyon kung ano ang pinakamalaking palitan na nais mong tanggapin sa isang presyo na nais mong bumili o magbenta.";

