	$translations['M01341']['english'] = "This can help you to avoid many orders coming in at the same time, resulting in a situation that cannot be dealt with. For instance, when you set it to 2, only two orders will be placed at the same time, and the next order will be allowed after you have finished processing.";
	$translations['M01341']['chineseSimplified'] = "2";
	$translations['M01341']['chineseTraditional'] = "2";
	$translations['M01341']['Malay'] = "Ini dapat membantu anda untuk mengelakkan  pesanan yang banyak masuk pada masa yang sama, yang diaman ianya mengakibatkan situasi yang tidak dapat ditangani. Sebagai contoh, apabila anda menetapkannya kepada 2, hanya 2 pesanan akan diletakkan pada masa yang sama, dan pesanan seterusnya akan dibenarkan selepas anda selesai memproseskannya.";
	$translations['M01341']['Indonesia'] = "Ini dapat membantu anda menghindari pesanan yang banyak datang pada saat yang sama, dimana itu menghasilkan situasi yang tidak dapat ditangani. Misalnya, ketika anda menetapkannya kepada 2, hanya 2 pesanan akan ditempatkan pada waktu yang sama, dan pesanan berikutnya akan diizinkan setelah anda selesai memprosesnya.";
	$translations['M01341']['Japanese'] = "22";
	$translations['M01341']['Korean'] = "          ,       . ,    2    2  ,        .";
	$translations['M01341']['Spanish'] = "Esto puede ayudarle a evitar que entren muchos pedidos al mismo tiempo, lo que resulta en una situacin que podra ser complicada de resolver. Por ejemplo, cuando se establece en 2, solo se podrn realizar 2 pedidos al mismo tiempo, y se permitir el siguiente pedido una vez que haya finalizado el procesamiento de uno de los anteriores.";
	$translations['M01341']['Portuguese'] = "Isso pode ajudar voc a evitar o recebimento de muitos pedidos ao mesmo tempo, resultando numa situao que no pode ser gerenciada. Por exemplo, quando voc defini-lo para 2, apenas 2 pedidos sero feitos ao mesmo tempo, e o prximo pedido s ser permitido aps voc ter terminado o processamento.";
	$translations['M01341']['Thai'] = "   2  2  ";
	$translations['M01341']['Filipino'] = "Matutulungan ka nitong maiwasan ang maraming order na sabay dumarating, na nagreresulta sa isang sitwasyong hindi matuos. Halimbawa, kung itatakda mo ito sa 2, 2 order lang ang mailalagay nang sabay, at ang susunod na order ay papayagan matapos mong magproseso.";

