	$translations['M01368']['english'] = "Cryptocurrency is the game changer of finance in future. The number of individual and corporate parties adapting to asset management via digital currency is steadily growing. We seized this opportunity; to create the safest cryptocurrency wallet in the world for you. TheNux wallet gives you the key to unlock (and lock) your own financial empowerment. Quite literally";
	$translations['M01368']['chineseSimplified'] = "; TheNux";
	$translations['M01368']['chineseTraditional'] = "; TheNux";
	$translations['M01368']['Malay'] = "Cryptocurrency adalah sebuah permainan yang memebawa perubahan terhadap kewangan pada masa akan datang. Bilangan penyesuaian parti individu dan korporat dengan pengurusan aset melalui mata wang digital terus berkembang. Kami mengambil peluang ini; untuk mencipta dompet cryptocurrency yang selamat di dunia untuk anda. Dompet TheNux  memberi anda kunci untuk membuka (dan mengunci) pemberdayaan kewangan anda sendiri. Sudah tentu.";
	$translations['M01368']['Indonesia'] = "Cryptocurrency adalah pengubah permainan keuangan di masa depan. Jumlah pihak individu dan perusahaan yang beradaptasi dengan manajemen aset melalui mata uang digital terus meningkat. Kami mengambil kesempatan ini; untuk membuat dompet cryptocurrency teraman di dunia untuk anda. Dompet TheNux memberi anda kunci untuk membuka (dan mengunci) pemberdayaan keuangan anda sendiri. Tentu saja.";
