	$translations['M01369']['english'] = "We bring together the most remarkable talents in cryptocurrency, software development, fintech as well as user experience to work as a team. As the market for digital currency is constantly evolving, this puts us on the right track to continue delivering innovations to enhance users lifestyle.";
